import CategoriesItem from './CategoriesItem';
import BackGround from './UI/BackGround';
import Card from './UI/Card';

function Categories() {
	const category = [
		{
			id: 'e1',
			title: 'History',
		},
		{ id: 'e2', title: 'Math' },
		{ id: 'e3', title: 'Music' },
	];

	return (
		<div>
			<BackGround />
			<Card className='content'></Card>
		</div>
	);
}

export default Categories;
